import React from "react";
import ThreadComments from "./ThreadComments";
import NewComments from "./NewComments";
import "./main.css";

const ThreadsArea = (props) => {
  return (
    <>
      <ThreadComments />
      <NewComments title="props.title" />
    </>
  );
};

export default ThreadsArea;
